import React from 'react';
import './App.css';
import Main from './main';

const pageList = ["Drama Channel", "Culture Channel", "Comedy Channel"]


function Index() {
  <Main></Main>
return <h1>{pageList[0]}</h1>
}

function About() {
  return <h1>{pageList[1]}</h1>  
}

function Users() {
  return <h1>{pageList[2]}</h1>  
}

function App() {
  return (
    <div className="App">
      {/* <header className="App-header">
        <h1>WebTV</h1><p>login</p>
      </header> */}
      <section className="contents1">
        <h1>{pageList[0]}</h1>
      </section>
      <Main></Main>
    </div>
  );
}

export default App;
